snippet.textDisplay:
Coke Studio isn't a studio only; it's a vibrant home celebrating diverse cultures with a level of excellence that consistently touches the soul.  Their commitment to showcasing the rich beauty of Pakistan, and the world, is astounding.

Hidayat Marwat, you are a treasure!  The way you represent Marwat and the broader Pashtoon community through your artistic skills, is breathtaking. We are so proud of you! And to the incredible artists of Lakki Marwat – your music, art, and joyous spirit, particularly your sculpting mastery,  are an inspiration to us all.
@zeeshanmarwat

